Day 4 of #30Days30Drills we got @deanthonymelton on some contrast jumps. We use a similar contrast in Vert Code Elite with dumbbells instead of the vertimax. For the resisted 1 step jump we want a resistance that allows for about 50% of our normal unresisted jump height. So if you jump 30 inches normally, you would use a resistance that allows you to get about 15 inches on a max intent jump.

After 4 reps we take a full recovery, then we do a short approach (3 step) max jump for 1 rep. We aim for 2-3 sets on each side (right-left for a few sets then left right for a few sets).

@deanthonymelton has made some big jump gains the past few years putting in work in the yard. Athleticism still going up! Getting scary 😈.
